    false,nt"url": null,nt"notes": "The Double-0 Plan is a step-down plan of
    the 1985 Refuge Master Plan and Environmental Assessment. The purpose of this plan
    is to guide the management, protection, and restoration of habitat on the Double-0
    Unit of the Malheur Refuge. Although this is a long-range plan , it will be evaluated
    after five years and will be updated as better management information is developed
    or to reflect changes in resource priorities. This plan will focus on the goal of
    improving wildlife habitat at the Double-0 Unit. Major actions will include: 1)
    protection of sensitive habitats and sites such as Research Natural Areas and archaeological
    sites; 2) Haying, grazing and burning of meadow vegetation to enhance habitat for
    spring feeding and breeding activity for waterbirds and nesting shorebirds; 3) management
    of water supplies to provide additional late season brood water; 4) maintenance
    and enhancement of nesting cover in uplands, marshes, meadows and riparian areas;
    5) elimination of interior fencing to reduce wildlife losses; 6) development of
    a grain field to provide a fall feeding and staging area for greater sandhill cranes;
    and 7) restoration of willow riparian zones that once existed downstream from the
    springheads and along Silver Creek. Two issues which have a major influence on wildlife
    viability at Double-0 are addressed in this plan. These issues are 1) management
    of limited water supplies for the benefit of wildlife species and 2) management
    of vegetation to enhance habitat conditions for wildlife species. Other issues which
    have a direct impact on the habitat, specifically carp and predators, are covered
    in depth in other management plans. Refuge land management practices will change
    with implementation of this plan. It will result in a reduction from 2400 to 1500
    acres grazed. Areas to be managed by haying will increase from about 350 acres a
    year to 750. Areas to be managed using prescribed burning will increase from about
    50 acres a year to an average of 700 acres a year. The remaining 15,600 acres of
    the Double-0 Unit will remain idle under this plan. The total estimated cost to
    enhance habitat under this plan is $115,000 over a five-year period.",nt"license_title":
